import React from 'react';

function AboutUs() {
  return (
    <div id="about" className="section">
      <div className="container">
        <h2 className="text-center">About Us</h2>
        <p className="section about">
          At UTRA, we aim to inspire creativity, enable collaboration and
          foster skill development. Participants can connect face-to-face,
          collaborate with global students, and engage with industry leaders
          and mentors. The event sparks inspiration and opens minds to endless
          possibilities. Hackers of all experience levels can join workshops,
          tech talks, and career sessions to learn something new. UTRA Hacks
          supports participants by providing necessary equipment, so that the
          sky's the limit!
        </p>
      </div>
    </div>
  );
}

export default AboutUs;
